import React from 'react';
import PropTypes from 'prop-types';

const WindowInputs = ({ idx, windowState, handleWindowChange }) => {
    const windowId = `name-${idx}`;
    const width = `width-${idx}`;
    const height = `height-${idx}`;
    return (
        <div key={`window-${idx}`}>
            <label htmlFor={windowId}>{`Window #${idx + 1}`}</label>
            <input
                type="text"
                name={windowId}
                data-idx={idx}
                id={windowId}
                className="name"
                value={windowState[idx].name}
                onChange={handleWindowChange}
            />
            <label htmlFor={ageId}>Age</label>
            <input
                type="text"
                name={ageId}
                data-idx={idx}
                id={ageId}
                className="age"
                value={windowState[idx].age}
                onChange={handleWindowChange}
            />
        </div>
    );
};

WindowInputs.propTypes = {
    idx: PropTypes.number,
    windowState: PropTypes.array,
    handleWindowChange: PropTypes.func,
};

export default WindowInputs;
